  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kenai
  National Moose Range and Tuxedni National Wildlife Refuge outlines Refuge accomplishments
  during the 1975 fiscal year. The report begins by summarizing the weather conditions
  and habitat conditions during the year. Wildlife- including migratory birds, upland
  game birds, big game animals, and furbearers- is also covered. The Refuge development
  and maintenance section discusses physical developments, prescribed burning, and
  wildfires. Resource management is outlined; topics include fur harvesting and timber
  removal. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses
  and violations.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
